EDCS_Status_Code
EDCS_Map3p1AttributeCode
(
          EDCS_Integer                               ea_3p1_code_in,
    const EDCS_3p1_4px_Attribute_Mapping_Structure **mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!mapping_info_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else if (ea_3p1_code_in < 1 || ea_3p1_code_in > EDCS_3P1_TOTAL_EA)
    {
        *mapping_info_out_ptr = NULL;
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else
    {
        *mapping_info_out_ptr = &(EDCS_3p1_4px_Attribute_Mappings[ea_3p1_code_in-1]);
    }
    return status;
} /* end EDCS_Map3p1AttributeCode */

static int
local_Compare3p1EALabel
(
    const EDCS_3p1_EA_Label_Entry *a_ptr,
    const EDCS_3p1_EA_Label_Entry *b_ptr
)
{
    int result = 0;

    if (!a_ptr && b_ptr)
        return -1;
    else if (!a_ptr && !b_ptr)
        return 0;
    else if (a_ptr && !b_ptr)
        return 1;

    result = edcs_internal_strcmp(a_ptr->label_3p1, b_ptr->label_3p1);
    return result;
} /* end local_Compare3p1EALabel */

EDCS_Status_Code
EDCS_3p1AttributeCodeFromLabel
(
    const char         *ea_3p1_label_in,
          EDCS_Integer *ea_3p1_code_out
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;
    EDCS_3p1_EA_Label_Entry *search_result_ptr = NULL, target;

    if (!ea_3p1_code_out)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!ea_3p1_label_in)
    {
        *ea_3p1_code_out = 0;
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else
    {
        target.label_3p1  = ea_3p1_label_in;
        search_result_ptr = (EDCS_3p1_EA_Label_Entry *)
                            bsearch
                            (
                               &target,
                               EDCS_3p1_EA_Label_Array,
                               EDCS_3P1_TOTAL_EA,
                               sizeof(EDCS_3p1_EA_Label_Entry),
                               (int(*)(const void*,const void *))
                                      local_Compare3p1EALabel
                            );

        if (search_result_ptr)
        {
            *ea_3p1_code_out = search_result_ptr->code_3p1;
        }
        else
        {
            status = EDCS_SC_INVALID_INPUT_LABEL;
        }
    }
    return status;
} /* end EDCS_3p1AttributeCodeFromLabel */

EDCS_Status_Code
EDCS_Map3p1AttributeLabel
(
    const char                                      *ea_3p1_label_in,
    const EDCS_3p1_4px_Attribute_Mapping_Structure **mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!mapping_info_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!ea_3p1_label_in)
    {
        *mapping_info_out_ptr = NULL;
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else
    {
        EDCS_Integer ea_code;

        status = EDCS_3p1AttributeCodeFromLabel(ea_3p1_label_in, &ea_code);

        if( status == EDCS_SC_SUCCESS)
        {
            status = EDCS_Map3p1AttributeCode(ea_code, mapping_info_out_ptr);
        }
    }
    return status;
} /* end EDCS_Map3p1AttributeLabel */
